import React from 'react';
import {Table} from 'react-bootstrap';
import ReactTable from 'react-table';
import "react-table/react-table.css";
import Axios from 'axios';


class AssigningDeveloper extends React.Component{
    constructor(props){
        super(props);
        this.state={data:null};
        Axios.get('http://localhost:3002/user',{withCredentials:true}).then(res=>{
            if(res.status===200){
                Axios.get('http://localhost:3002/get_all_developers',{header:{Authorization: `Bearer ${res.data}`}})
                .then(res=>{
                    this.setState({data:res.data});
                })
            }
        })
    }
    render() {
        const { data } = this.state;
        return (
          <div style={{marginTop:"5em",width:"50%",margin:"5em 25%"}}>
          <h1>{this.props.match.params.id}</h1>
            <ReactTable style={{textAlign:"center"}}
              data={data}
              columns={[
                {
                  Header: "Name",
                  accessor:"name"
                },
                {
                  Header: "ContactNo.",
                  accessor:"contactNo"
                },
                {
                  Header: 'Skills',
                  accessor:"skills"
                }
              ]}
            />
            <br />
          </div>
        );
      }
}
export default AssigningDeveloper;
